import "./App.css";

import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

function App() {
	return (
		<div className="app">
			<Router>
				<Routes>
					<Route path="/" element={<Home />} />
					<Route path="/home" element={<Home />} />

				</Routes>
			</Router>
		</div>
	);
}

export default App;
